"""
At a lemonade stand, each lemonade costs $5.

Customers are standing in a queue to buy from you, and order one at a time (in the order specified by bills).

Each customer will only buy one lemonade and pay with either a $5, $10, or $20 bill.  You must provide the correct
 change to each customer, so that the net transaction is that the customer pays $5.

Note that you don't have any change in hand at first.

Return true if and only if you can provide every customer with correct change.
"""
from typing import List, Tuple


def lemonade_change_generic(bills: List[int], face_values: Tuple = (20, 10, 5), product_value: int = 5) -> bool:
    """
    :param bills: order of the bills received, 0 <= len(bills) <= 10000, and bills[i] is in face_values
    :param face_values: Tuple of cash values in descending order
    :param product_value: price of the product sold
    :return: start with no changes, can make changes to customers in the list
    """
    if not bills:
        return True
    face_values_lookup = {value_i: i for i, value_i in enumerate(face_values)}
    if bills[0] != product_value:
        return False
    change_count = [0] * len(face_values)
    change_count[face_values_lookup[product_value]] = 1

    for bill_i in bills[1:]:
        get_bill = face_values_lookup[bill_i]
        change_count[get_bill] += 1
        need_change = bill_i - product_value
        possible_value_i = get_bill + 1
        while need_change and possible_value_i < len(face_values):
            if face_values[possible_value_i] > need_change or change_count[possible_value_i] == 0:
                possible_value_i += 1
            else:
                need_change -= face_values[possible_value_i]
                change_count[possible_value_i] -= 1
        if need_change:
            return False

    return True


def lemonade_change_specific(bills: List[int]) -> bool:
    """
    :param bills: order of the bills received, 0 <= len(bills) <= 10000, and bills[i] is in face_values
    :return: start with no changes, can make changes to customers in the list
    """
    five_count = ten_count = 0
    for bill_i in bills:
        if bill_i == 5:
            five_count += 1
        elif bill_i == 10:
            if not five_count:
                return False
            ten_count += 1
            five_count -= 1
        else:
            if five_count and ten_count:
                ten_count -= 1
                five_count -= 1
            elif five_count > 2:
                five_count -= 3
            else:
                return False
    return True


